import React from 'react';
import SignUp from './components/auth/SignUp'
import Search from './components/shareItContent/search/Search'
import './App.css'
import NavigationBar from './components/layouts/NavigationBar';
import FooterCom from './components/layouts/FooterCom';
import { BrowserRouter, Switch, Route } from 'react-router-dom'
import NewDrive from './components/shareItContent/newDrive/NewDrive'
import DriveForm from './components/shareItContent/newDrive/DriveForm';

function App() {
  return (
    <BrowserRouter>
            <div className="App">
              <NavigationBar/><br/><br/> <br/>
              <Switch>
                <Route exact path='/' component={SignUp}/>
                <Route path='/search' component={Search}/>
                <Route path='/new_drive' component={DriveForm}/>
                
              </Switch>
              <FooterCom/>
            </div>
          </BrowserRouter>)
          ;

}

export default App;
